import React from 'react';
import './App.css';
import SerieCard from "./Components/SerieCard/SerieCard"

function App() {
  let object ={
      id:1,
      poster:"posters/siliconvalley.jpg",
      rating:8.5,
      title:"Sillicon Valley",
      date:"2014-2019",
      Overview:"Follows the struggle of Richard Hendricks, a Silicon Valley engineer trying to build his own company called Pied Piper.",
    }
  return (
    <React.Fragment>
      <SerieCard Serie={object}>
      </SerieCard>
    </React.Fragment>
  );
}

export default App;
